    false,nt"url": null,nt"notes": "This data set is an LAZ (compressed LAS)
    format file containing LIDAR point cloud data. The NAD83/2011 geodetic products
    were delivered as individual LAS files representing the geographic extent of each
    uniquely identified and acquired flight line or lift. USACE regularly uses digital
    topographic information to support regulatory, land management and acquisition,
    planning, engineering and habitat restoration projects. The data were classified
    into 4 classifications; (1) unclassified, (2) ground, (9) water,and (12) overlap
    points. The full study area of approximately 404 square km was processed. The tiles
    are 1,000 x 1,000m in size and Final deliverables were provided as geographic coordinates
    referenced to the North American Datum of 1983/2011 Realization (NAD83/2011) and
    as projected coordinates referenced to the State Plane Coordinate System, Puerto
    Rico Virgin Islands FIPS Zone 5200, NAD83/2011, vertical PRVD02 orthometric height.
    Upon arrival to NOAA's Office for Coastal Management the data were converted from
    State Plane to geographic and from NAVD88 (orthometric) heights in feet to GRS80
    (ellipsoid) heights in meters using Geoid 12a. Original project title was "2013
    Greater San Juan, Puerto Nuevo, Rio de la Plata".",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
